pragma solidity ^0.6.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./DeflyNFT.sol";
import "./DeflyMarketplace.sol";

contract DeflyTicketsFactory is Ownable {
    struct Defly {
        string deflyName;
        string deflySymbol;
        uint256 ticketPrice;
        uint256 totalSupply;
        address marketplace;
        string fileUrl;
    }

    address[] private activeDeflys;
    mapping(address => Defly) private activeDeflysMapping;

    event Created(address ntfAddress, address marketplaceAddress);

    // Creates new NFT and a marketplace for its purchase
    function createNewDefly(
        DeflyToken token,
        string memory deflyName,
        string memory deflySymbol,
        uint256 ticketPrice,
        uint256 totalSupply,
        string memory fileUrl
    ) public onlyOwner returns (address) {
        DeflyNFT newDefly =
            new DeflyNFT(
                deflyName,
                deflySymbol,
                ticketPrice,
                totalSupply,
                msg.sender,
                fileUrl
            );

        DeflyMarketplace newMarketplace =
            new DeflyMarketplace(token, newDefly);

        address newDeflyAddress = address(newDefly);

        activeDeflys.push(newDeflyAddress);
        activeDeflysMapping[newDeflyAddress] = Defly({
            deflyName: deflyName,
            deflySymbol: deflySymbol,
            ticketPrice: ticketPrice,
            totalSupply: totalSupply,
            marketplace: address(newMarketplace),
            fileUrl: fileUrl
        });

        emit Created(newDeflyAddress, address(newMarketplace));

        return newDeflyAddress;
    }

    // Get all active Deflys
    function getActiveDeflys() public view returns (address[] memory) {
        return activeDeflys;
    }

    // Get Defly's details
    function getDeflyDetails(address deflyAddress) public view returns (string memory,string memory,uint256,uint256,address,string memory){
        return (
            activeDeflysMapping[deflyAddress].deflyName,
            activeDeflysMapping[deflyAddress].deflySymbol,
            activeDeflysMapping[deflyAddress].ticketPrice,
            activeDeflysMapping[deflyAddress].totalSupply,
            activeDeflysMapping[deflyAddress].marketplace,
            activeDeflysMapping[deflyAddress].fileUrl
        );
    }
}
